(55050, 10, NULL, '~0110659f9143cc87bf', '\"As a highly experienced IT professional with over a decade of experience in remote computer repair, I am dedicated to providing top-notch service to my clients. I specialize in troubleshooting and repairing both Windows and Mac systems, ensuring that your computer runs at optimal performance. I am well-versed with Remote access tools and I offer a wide range of services, including software installation, data recovery, virus and malware removal, performance optimization and network troubleshooting.\n\nI pride myself on my exceptional customer service and quick turnaround time. My remote services are not only fast and reliable but also more cost-effective than traditional in-person repair options. I am available to assist you on your schedule and will work with you to find the best solution to your IT problems. With my technical expertise and commitment to customer satisfaction, you can trust me to keep your computer running smoothly.\"\n\nIn this version, I focused on your expertise and experience and the wide range of service you provide. Emphasizing the cost-effectiveness of your remote services and your availability to assist clients on their schedule. I also highlighted your commitment to customer satisfaction which is very important for building trust.\n\nI also have full command over Microsoft office, online data research and data entry. \n\n‚úîÔ∏è Installation/uninstallation (programs, devices)\n\n‚úîÔ∏è Cleaning from viruses, spyware, and malware.\n\n‚úîÔ∏è Speed up (optimization)\n\n‚úîÔ∏è Cleaning unnecessary files.\n\n‚úîÔ∏è Driver installation (compatible with Operating System)\n\n‚úîÔ∏è Cleaning browser from add-ons\n\n‚úîÔ∏è Problem diagnostic (software and hardware)\n\n‚úîÔ∏è Data Recovery\n\n‚úîÔ∏è Can help in gaining of lost password (win login)\n\n‚úîÔ∏è Remove Toolbars in your Browser.\n\n‚úîÔ∏è Upgrading of your Hardware for Better Performance\n\n‚úîÔ∏è Other computer issues\n\n‚úîÔ∏è Teach how to save your important file to online Drive (Auto Back Up)\n\n‚úîÔ∏è Installation of Windows, Mac, and Linux in a dead PC.\n\n\nContact me for other types of problems you are having with your Computer, Laptop, and other devices. Please provide as much information about the problem you are having, I am here to solve your problem.\n\nThank You', NULL, NULL, NULL, NULL, 'ASHOK J.', 'IT/HelpDesk Support/Technician (Mac/Windows/Outlook/Printers/Etc..)', 'Aligarh, India', NULL, NULL, '0', NULL, '100', '74', '65', '\"[\\\"Microsoft Windows\\\",\\\"End User Technical Support\\\",\\\"Email Support\\\",\\\"Windows 10 Administration\\\",\\\"Network Administration\\\",\\\"Microsoft Outlook\\\",\\\"Antivirus & Security Software\\\",\\\"Customer Support\\\",\\\"Technical Support\\\",\\\"Hardware Troubleshooting\\\",\\\"Windows Administration\\\",\\\"Troubleshooting\\\",\\\"Windows 7 Administration\\\",\\\"Computer Hardware Installation\\\",\\\"Computer Maintenance\\\"]\"', NULL, 'api', '2025-10-01 15:51:54', '2025-10-01 15:51:54', '2025-10-01 15:51:54', 'https://www.upwork.com/freelancers/~0110659f9143cc87bf'),
(55049, 10, NULL, 'muhammadamanullah', 'I‚Äôm a results-driven IT Leader and Infrastructure Architect with over nine years of progressive experience in designing, implementing, securing, and managing complex IT infrastructures across diverse industries. \n\nMy career spans network engineering, solution architecture, systems administration, DevOps, and IT strategy, with a strong foundation in both on-prem and cloud ecosystems. I‚Äôve architected and led full-scale deployments across routing, switching, security, WLAN, NAC, NMS, SIEM, and IAM using Cisco, Juniper, Fortinet, Aruba, Ruckus, HPE, Microsoft, AWS, and GCP.\n\nI have successfully led PCI DSS and ISO 27001 compliance projects, implemented privileged access management (PAM), identity governance, conditional access, and deployed SIEM solutions like Azure Sentinel to enhance monitoring and threat response.\n\nMy DevOps expertise includes Docker, Docker Compose, Kubernetes, Terraform, Ansible, PowerShell, Bash, Python, and CI/CD automation, driving Infrastructure as Code (IaC), system hardening, and zero-downtime deployments. I also bring deep operational knowledge of Microsoft 365, Entra ID, Exchange, SharePoint, Teams, and collaboration tools like Jira, Confluence, and Miro.\n\nAs a CTO / Head of IT, I now lead cross-functional teams, manage internal and client infrastructures, define IT roadmaps, and ensure enterprise-grade performance, resilience, and compliance. I work at the intersection of technology, security, and business outcomes, driving digital transformation through innovation and strategic execution.\n\nBelow are my services:\n\nNETWORKING:\n1. Network designing, HLDs, LLDs, and Network diagrams on MS Visio\n2. Network automation, configurations, testing, and troubleshooting\n3. Network support level 1/2/3, managed services on a monthly subscription/SLAs\n4. Technical proposals, RFPs\n\nPlatforms: Juniper (SRX Series, EX Series, MX Series, Junos space), Aruba (ClearPass/WLAN), Cisco (routers/switches/firewalls/WLAN/ISE), Ruckus WLAN, Fortinet firewalls, Whatsup gold, Cisco VoIP phone SPA series\nNetworking Expertise: Routing protocols (OSPF, EIGRP, RIP, BGP), STP, RSTP, VLANs, DNS, DHCP, MPLS, VRRP, HSRP, NAT/CGNAT, PAT, ACLs, port forwarding\n\nIT Infrastructure/DevOps:\n1.  IT strategy, IT infrastructure design, IT automation\n2. Infrastructure as Code (IaC) on AWS, Azure, GCP, OCI, and other cloud providers.\n3. System administration, IT support on a monthly subscription/SLAs\n\nSkills: Linux (Ubuntu, CentOS, Debian, RHEL), Windows servers (R2012, R2016, R2019, R2022), Digital Ocean, Active Directory, Microsoft Exchange, SharePoint, Entra ID, Jira, Confluence, Miro, Zoho, Rocket chat, Hyperledger, VMware, FusionPBX, AWS, Azure, GCP, Apache, Docker, Kubernetes, Ansible, Terraform, Bash, PowerShell, Python, ISO 27001, PCI DSS, Zabbix, Azure Sentinel', NULL, NULL, NULL, NULL, 'Muhammad Aman U.', 'Network Architect | Cloud & DevOps Specialist | IT Support', 'Rawalpindi, Pakistan', NULL, NULL, '0', NULL, '89', '32', '90', '\"[\\\"Juniper\\\",\\\"Cisco\\\",\\\"IT Service Management\\\",\\\"DevOps\\\",\\\"Ansible\\\",\\\"Microsoft Azure\\\",\\\"Amazon Web Services\\\",\\\"Docker\\\",\\\"Kubernetes\\\",\\\"Aruba\\\",\\\"Fortinet\\\",\\\"ISO 27001\\\",\\\"Network Design\\\",\\\"System Administration\\\",\\\"IT Support\\\"]\"', NULL, 'api', '2025-10-01 15:51:05', '2025-10-01 15:51:05', '2025-10-01 15:51:05', 'https://www.upwork.com/freelancers/muhammadamanullah'),
