DVD, USB, external/network storage)', NULL, NULL, NULL, NULL, 'Jason Ross D.', 'IT Specialist', 'Dasmarinas, Philippines', NULL, NULL, '0', NULL, '100', '2', '2,443', '\"[\\\"IT Recruiting\\\",\\\"Microsoft Windows\\\",\\\"Management Skills\\\",\\\"IT Infrastructure\\\",\\\"IT Service Management\\\",\\\"ITIL\\\",\\\"IT Management\\\",\\\"Helpdesk\\\",\\\"Desktop & Laptop Support\\\",\\\"Storage Device\\\",\\\"Microsoft Azure\\\",\\\"Microsoft Azure Administration\\\",\\\"Microsoft Intune\\\",\\\"Microsoft Office\\\",\\\"POS Terminal\\\"]\"', NULL, 'api', '2025-10-01 15:50:44', '2025-10-01 15:50:44', '2025-10-01 15:50:44', 'https://www.upwork.com/freelancers/~011f5b939e5f48bcf7'),
(55047, 10, NULL, 'hoangd15', 'PROFILE\nHardware Designer | IoT Product Development Specialist\n\nExperienced hardware engineer with over 6 years of expertise in end-to-end IoT product design ‚Äî from concept and prototyping to mass production. Skilled in identifying and solving complex hardware issues, with a strong foundation in embedded systems and PCB design. Proven ability to take ideas from initial requirements through to manufacturing, ensuring reliability, performance, and cost-effectiveness.\n\nCore Competencies:\n-PCB Layout Design\n-Schematic Capture\n-Hardware Debugging & Troubleshooting\n-Research & Development\n-BOM Creation & Gerber File Generation\n\nTechnical Skills & Capabilities:\n-Extensive experience in embedded systems design and circuit development using tools such as Altium Designer, KiCAD, OrCAD, HDL, and EasyEDA.\n-Proficient in working with 8-bit, 16-bit, and 32-bit ARM microcontrollers, as well as FPGAs and external memory interfaces (SDRAM, DDR2/3/4/5, LPDDR).\n-Strong knowledge of analog and digital components including ADCs, DACs, Op-Amps, transistors, MOSFETs, and voltage regulators.\n-Experienced with a wide range of communication protocols: RS-232, RS-485, SPI, I2C, I2S, UART, USB, PHY, LVDS, CAN, LIN, PCIe.\n-Hands-on experience with lab equipment: Oscilloscopes, precision multimeters, soldering/rework stations.\n-Familiar with mass production processes for volumes ranging from 1K to 10K+ units.\n-Basic proficiency in 3D CAD software for mechanical integration and enclosure design.', NULL, NULL, NULL, NULL, 'Hoang D.', 'Hardware Engineer', 'Ho Chi Minh City, Vietnam', NULL, NULL, '0', NULL, '100', '52', '151', '\"[\\\"Prototyping\\\",\\\"Manufacturing\\\",\\\"Hardware Design\\\",\\\"C\\\",\\\"Hardware Troubleshooting\\\",\\\"Firmware Programming\\\",\\\"Digital Design\\\",\\\"Microcontroller\\\",\\\"KiCad\\\",\\\"Altium Designer\\\",\\\"Microcontroller Design\\\",\\\"ESP32\\\",\\\"Python\\\",\\\"STM32\\\",\\\"Arduino\\\"]\"', NULL,