(55045, 10, NULL, 'adrianmcintosh', 'Greetings! My name is Adrian McIntosh, and I am a seasoned Network Manager/Administrator with a deep interest in guaranteeing smooth network operations and strong cybersecurity. I possess over 15 years of experience, during which time I have effectively managed and enhanced networks, minimized security risks, and offered exceptional IT assistance to various organizations.\n\nCore Competencies\n- Network Management:\n- All Windows Server (2008 - 2022)\n- All Windows Desktop OS\n- Cisco Routers and Switching\n- Meraki Management\n- Network Troubleshooting\n- NAS/SAN (Synology, QNAP)\n\nCybersecurity:\n- Network Security\n- Pentesting (Tenable, Nmap)\n- Anti-Virus Solutions (Carbon Black, Symantec)\n- PCI Compliance\n\nCloud & Virtualization:\n- Azure/AWS Cloud Services\n- Virtualization (VMware, Hyper-V, Proxmox)\n- Google Workspace\n\nCommunication & Collaboration:\n- Exchange Management\n- Microsoft 365\n\nAdditional Proficiencies:\n- Helpdesk/Ticketing Systems (Zendesk)\n- Documentation Tools (Hudu)\n- Remote Monitoring and Management (NinjaRMM, Intune)\n\nServices Offered:\nI specialize in:\n- Comprehensive Network Management\n- Advanced Cybersecurity Solutions\n- Cloud Services Integration (Azure/AWS)\n- Virtualization Implementation and Management\n- IT Support and Helpdesk Services\n\nI appreciate your review of my profile. I can confidently assist you with your network management and cybersecurity needs. My mission is to ensure that your organization runs smoothly and is well-protected. Let\'s work together to achieve these goals.', NULL, NULL, NULL, NULL, 'ADRIAN M.', 'IT Solution Provider', 'Carteret, USA', NULL, NULL, '0', NULL, '100', '45', '214', '\"[\\\"Windows Server\\\",\\\"Office 365\\\",\\\"Microsoft Azure\\\",\\\"Amazon Web Services\\\",\\\"Microsoft Active Directory\\\",\\\"Business with 1-9 Employees\\\",\\\"Technical Support\\\",\\\"Network Security\\\",\\\"System Configuration\\\",\\\"Tech & IT\\\",\\\"Network Administration\\\",\\\"VPN\\\",\\\"Microsoft Hyper-V Server\\\",\\\"Network Design\\\",\\\"Cybersecurity Management\\\"]\"', NULL, 'api', '2025-10-01 15:50:00', '2025-10-01 15:49:59', '2025-10-01 15:50:00', 'https://www.upwork.com/freelancers/adrianmcintosh'),
(55044, 10, NULL, '~0161f8b18042faaba6', 'From high-converting content, blog articles, and technical writing to complex content strategies, everything I offer is designed around building your business and level of professionalism.\n\n\"Tyler is a wonderful businessman that takes time and care with his customers\' needs to be sure that they are completely satisfied with the services that he provides.\" - Stacy Wisser. (from my LinkedIn profile).\n\n\"Tyler is an expert and a real gentleman. He never tries to oversell beyond the needs of his customer and gets you exactly what you need at a very fair price.  You\'ll be very glad you did business with him.\" - David Coulter. (from my TVH Computers reviews, of which I have 38 Google and 22 Facebook reviews).\n\n\"Tyler has always been very helpful, fast and affordable. I won\'t ever need to go anywhere else.\" - Kevin Nagle, Beltzville Stand-up Paddle. (from my Ty Dev Studios Google My Business profile).\n\nMy goal is to make your business appear more professional and trustworthy online by creating content from an authoritative perspective, with fact-checked, well-sourced, and optimized copy.\n\nA little about me:\n\nWriting about technology, software, hardware, and coding is my strongsuit. As a tech business owner, my experience ranges from small business technology, staffing, managed services, and web development to creating expansive content plans and strategies.\n\nAs a content creator, I leverage my experience to write beautiful content. One of my favorite parts of writing is the art of breaking down complex technical concepts into easy-to-understand chunks of information.\n\nI have a YouTube channel where I provide web-dev tutorials (look up Tyler Von Harz on YouTube). I also wrote and published a book about my own computer business on Amazon called \"Start A Computer Store From Scratch: An Intro To Everything You Need To Open Your Own Computer Repair Store.\" I have been developing WordPress websites since 2017.\n\nServices I can offer your business:\n\n- Technical writing\n- Technical documentation\n- Tech blogs and content\n- Tech and software tutorials\n- Programming and coding tutorials\n- Ebooks, whitepapers, and guides\n- Editing and proofreading\n- Optimizing existing articles and websites\n- Content strategy and ideation\n- Everything at the crossroads of technology and writing!\n\nWho I work with:\n\nI work with the type of business owner who cares about quality, because you know getting A+ work will put more money in YOUR pocket. If that sounds like you, and you want to KNOW you\'re squeezing every dollar out of the effort you\'ve put into your business, I\'m the right guy to help.\n\nHere\'s what to do next:\n\nSend me a note with some info about your company, what you do, how long you\'ve been doing it, and what you have in mind for your project. We\'ll schedule a call to talk if it looks like we may be a good fit.', NULL, NULL, NULL, NULL, 'Tyler H.', 'Content Creator, Writer, and Strategist with IT and Coding Background', 'Kunkletown, USA', NULL, NULL, '0', NULL, '100', '40', '24', '\"[\\\"Technical Writing\\\",\\\"Tech & IT\\\",\\\"Search Engine Optimization\\\",\\\"Editing & Proofreading\\\",\\\"Blog Content\\\",\\\"WordPress\\\",\\\"HTML5\\\",\\\"CSS\\\",\\\"Content Writing\\\",\\\"Writing\\\",\\\"SEO Writing\\\",\\\"Article Writing\\\",\\\"Blog Writing\\\",\\\"JavaScript\\\"]\"', NULL, 'api', '2025-10-01 15:49:58', '2025-10-01 15:49:58', '2025-10-01 15:49:58', 'https://www.upwork.com/freelancers/~0161f8b18042faaba6'),
(55043, 10, NULL, '~010fd7781772fe7aed', 'Analog and digital designer. Programmer of micro controllers in C or Assembly.\n\nSchematic, and PCB design and manufacture.\n\n35 years experience in the electronics industry, from R&D to industrial systems.\n\nBSEE: Devry Institute of Technology  1979-1980 & 1987-1988.\n\nI have been involved with electronic engineering, and systems repair for  the last 35 years. I have designed everything from radios to computers, and everything in between.  \nMy methods are simple. Design the needed system, do the coding, prototyping, and testing. if all tests pass.then create the schematic, design the PC board and Gerber files, and have some samples manufactured. Then in the lab solder all components on the board, whether through hole or surface mount types. Test the circuit board, and deliver the product with all details.', NULL, NULL, NULL, NULL, 'Lui J.', 'Electronic Engineer', 'Atlanta, USA', NULL, NULL, '0', NULL, '100', '43', '3,011', '\"[\\\"Product Design\\\",\\\"C++\\\",\\\"Arduino\\\",\\\"Hardware Troubleshooting\\\",\\\"Hardware Design\\\",\\\"Embedded C\\\",\\\"Electrical Engineering\\\",\\\"Electronics\\\",\\\"Internet of Things\\\",\\\"Engineering Design\\\",\\\"PCB Design\\\",\\\"Electrical Layout Design\\\",\\\"Arduino Firmware\\\",\\\"Embedded System\\\"]\"', NULL, 'api', '2025-10-01 15:49:05', '2025-10-01 15:49:04', '2025-10-01 15:49:05', 'https://www.upwork.com/freelancers/~010fd7781772fe7aed'),
(55042, 10, NULL, 'sajjadit', 'With over 9 years of hands-on experience, I am a certified Systems Administrator specialising in Microsoft Office 365, Windows Server, and macOS environments. My focus is on providing robust, secure, and reliable IT solutions that keep your business running smoothly. From seamless cloud migrations and security management to troubleshooting complex network issues, I deliver expert-level support that reduces downtime and protects your data. I hold certifications including MCSA: Office 365 and MCP: Microsoft Azure, ensuring I provide solutions built on the latest industry standards.\n\nCloud & Microsoft Services\n\n- Microsoft 365 & Google Workspace Administration\n- Email, Calendar, & DNS Configuration\n- Data Migration (PST, Exchange, On-Premise to Cloud)\n- Microsoft Exchange Hybrid Deployment\n- Azure Active Directory Sync (DirSync)\n- Single Sign-On (SSO) for M365\n\nOperating Systems & Servers\n\n- Windows Server (2008R2, 2012R2, 2016, 2019)\n- Windows (7, 8, 10, 11)\n- macOS & macOS Server\n\nVirtualisation & Desktop Support\n\n- Hyper-V, VMware Workstation\n- Remote Desktop & Technical Support\n- Data Backup & Recovery Solutions\n- Account Security & Recovery', NULL, NULL, NULL, NULL, 'Sajjad S.', 'System Administrator / Office 365 Administrator', 'Karachi, Pakistan', NULL, NULL, '0', NULL, '100', '252', '642', '\"[\\\"Virtual Machine\\\",\\\"Virtualization\\\",\\\"Microsoft Exchange Online\\\",\\\"Windows 11 Administration\\\",\\\"Computer Hardware Installation\\\",\\\"Open Networking Operating System\\\",\\\"Computer Skills\\\",\\\"Data Migration\\\",\\\"Windows 10 Administration\\\",\\\"Office 365\\\",\\\"Microsoft Outlook\\\",\\\"Printer\\\",\\\"Graphic Design\\\",\\\"Cloud Architecture\\\"]\"', NULL, 'api', '2025-10-01 15:48:50', '2025-10-01 15:48:49', '2025-10-01 15:48:50', 'https://www.upwork.com/freelancers/sajjadit'),
