(55040, 10, NULL, '~01d85e830c4cc4bedb', 'As an Expert PCB Design Engineer and product developer. I have the determination and knowledge to build products from initial idea to prototype, with respect to latest technologies by merging my 7 years of professional expertise with the capacity to evaluate, design, and implement a wide range of complex electronic embedded/standalone system. I enjoy developing, innovating, designing, and motivating my self from my work.\n\n‚ûä‚úÖMyTechnical Skills:\n‚û§Electronic System Design:\n1-PCB Creation (Schematics Design, PCB design, BOM creation, Gerber file...)\n2-Analog Circuit Design (Measurement, power supply, A/D and D/A Converters, & filters...)\n3-Digital Circuit Design\n4-Interface Buses (SPI, I2C, RS-232, RS-485, ...)\n5-Memory Interfaces (DDR1-3, SDRAM, Serial/Parallel Flash, ...)\n6-High Speed I/O Interfaces (USB, Ethernet, PCI Express, LVDS, ...)\n7-Embedded Microcontroller Software Design (Arduino, PIC, STM32, AVR, EFM32, Novatec)\n8-Having sound knowledge of Fast Board Design - Multi-core processors, DDR, MIPI, Ethernet, USB, SDIO\n9-Bluetooth, ZigBee, Wi-Fi, LoRa, and Sub-GHz RF Design\n10-Expertise in MSP430, STM32, ATMEGA, A20, Free-scale MC9SC, 8-Bit to 32 Bit microcontroller System designs\n\n‚ûã‚úÖMechanical Housing Design for PCB\n1-Product enclosure Design review for optimal manufacturing (Specialised in injection molding and 3D printing-In House Facility).\n2-CAD Design, Visualisation, and Simulations in Solidworks, Autodesk Inventor, and Fusion 360.\n3-Solidworks Design with simulation and animation \n4-Marketing Advertisement Animations for the product.\n\n‚û§Design Tools Experience:\n1-Altium Designer (Professional)\n2-Kicad\n3-Eagle\n4-Proteus\n5-Cadence Allegro/OrCAD\n6-SolidWorks\n\nI am open to new methodologies, tools, and technologies. I always provide the top optimised design with respect to cost, reliability and robustness. Looking forward to discuss with you about your product ideas\n\nBR,\nAsad Azhar', NULL, NULL, NULL, NULL, 'Asad A.', 'PCB Design, Embedded System, Product Hardware Developer', 'Karachi, Pakistan', NULL, NULL, '0', NULL, '100', '25', '337', '\"[\\\"3D Modeling\\\",\\\"PCB Design\\\",\\\"Multilayer PCB\\\",\\\"Schematic\\\",\\\"Circuit Design\\\",\\\"Prototype\\\",\\\"Electronic Design\\\",\\\"Firmware Programming\\\",\\\"Electronics\\\",\\\"Electrical Design\\\",\\\"Power Electronics\\\",\\\"Electrical Engineering\\\",\\\"Altium Designer\\\",\\\"Bill of Materials\\\",\\\"Firmware\\\"]\"', NULL, 'api', '2025-10-01 15:48:31', '2025-10-01 15:48:30', '2025-10-01 15:48:31', 'https://www.upwork.com/freelancers/~01d85e830c4cc4bedb'),
(55039, 10, NULL, '~0133100857a4c6822b', '10+ Years. 100% Job Success. Zero guesswork.\nSenior QA Engineer trusted by international teams to deliver clean, reliable testing across web and mobile platforms.\nMy job is simple: catch what others miss, and make sure your users never see a broken experience.\n\nI specialize in:\n	‚Ä¢	Manual & Functional Testing\n	‚Ä¢	Regression & Smoke Testing\n	‚Ä¢	Test Case Design & Execution\n	‚Ä¢	UI/UX, Cross-Browser & Compatibility Testing\n	‚Ä¢	Bug Reporting (clear steps, screenshots, reproducible scenarios)\n	‚Ä¢	Mobile Testing (iOS, Android) & Web Testing (Windows, macOS)\n\nüõ† Tools I use daily:\n	‚Ä¢	Jira, Trello, TestLink\n	‚Ä¢	TeamViewer, Remote Desktop\n	‚Ä¢	Postman (for basic API testing)\n\nüí¨ I communicate clearly with developers during daily stand-ups, ensuring fast fixes and smooth delivery. Agile/Scrum? I‚Äôm used to it.\n\nüéØ I also bring 12+ years of IT Technical Support background:\n	‚Ä¢	Network Troubleshooting\n	‚Ä¢	System Maintenance\n	‚Ä¢	Hardware/Software Diagnostics\n	‚Ä¢	Remote Support & VPN\n\n‚úÖ When you hire me, you get:\n	‚Ä¢	Clean, professional bug reports\n	‚Ä¢	Test coverage that protects your reputation\n	‚Ä¢	A QA partner who takes ownership, not just tasks\n\nLet‚Äôs make your app bulletproof.\nMessage me ‚Äî I respond fast.', NULL, NULL, NULL, NULL, 'Hussain R.', 'QA Tester | IT Technical Support | FinTech, Casino, Crypto, AI, Web3', 'Arish, Egypt', NULL, NULL, '0', NULL, '100', '32', '189', '\"[\\\"Arabic\\\",\\\"Egyptian Arabic Dialect\\\",\\\"Software QA\\\",\\\"Performance Testing\\\",\\\"Helpdesk\\\",\\\"Software Testing\\\",\\\"Manual Testing\\\",\\\"Usability Testing\\\",\\\"System Administration\\\"]\"', NULL, 'api', '2025-10-01 15:48:20', '2025-10-01 15:48:20', '2025-10-01 15:48:20', 'https://www.upwork.com/freelancers/~0133100857a4c6822b'),
(55038, 10, NULL, 'maheshkumarthegreat', 'I\'m IT Executive  on Upwork, with 10 year experience in IT.\n\nI‚Äôve good knowledge of IT and experience in given skills including:\n‚úÖ office 365 and Microsoft outlook\n‚úÖ DHCP DNS and Active directory\n‚úÖWindows Linux and Mac\n\n‚úÖ Software installation and troubleshooting.\n‚úÖ VPN, Antivirus, Network security, Linux and server and network printers.\n\n‚≠êÔ∏è Here‚Äôs what I can bring to your project ‚≠ê\n\n‚úÖ Hardware networking and software professional with 10+ years of experience.\n‚úÖ Microsoft outlook , office 365 , Teams , Compliances software\'s etc.\n‚úÖ Expertise Hardware networking and softwares troubleshooting, email configure.\n‚úÖ .Windows 11, 10 and 8 administration.\n‚úÖ Skills in Zoho and outlook 365.\n‚úÖ Worked on ticketing tools Kaseya, ServiceDesk and ITSM.\n‚úÖ Fast, reliable communication‚Äîyou‚Äôll always know the status of your project.\n‚úÖ Passionate about helping you succeed and grow your business.\n\n‚úÖ Professionalism: Respect, empathy, and a genuine desire to help are at the core of how I work.\n\nLet‚Äôs connect and see how I can bring your vision to life with content that truly resonates.', NULL, NULL, NULL, NULL, 'Mahesh K.', 'Outlook o365 Windows Linux Mac Printers Server DNS', 'Morinda, India', NULL, NULL, '0', NULL, '67', '5', '3', '\"[\\\"Microsoft Outlook\\\",\\\"Office 365\\\",\\\"DHCP\\\",\\\"DNS\\\",\\\"Microsoft Active Directory\\\",\\\"Windows Server\\\",\\\"Windows 11 Administration\\\",\\\"Linux\\\",\\\"macOS\\\",\\\"Remote IT Management\\\",\\\"Asset Management\\\",\\\"Ticketing System\\\",\\\"Printer\\\",\\\"Desktop Support\\\",\\\"Microsoft Windows\\\"]\"', NULL, 'api', '2025-10-01 15:47:11', '2025-10-01 15:47:11', '2025-10-01 15:47:11', 'https://www.upwork.com/freelancers/maheshkumarthegreat'),
(55037, 10, NULL, '~01bf7daa62f2e2d022', 'My skill set includes the following but not limited to: \n\n-IT Support\n-Experienced technical support\n-Excel proficient\n-Email and Call handling\n-Virtual assistant\n-Data entry\n-Microsoft Office 365 expert\n-Windows 10 expert\n\n\nMy goal is not to just provide exceptional work but to build a good relationship with my clients. To leave a mark by showing how compassionate and dedicated I am towards my work or any given task. To build trust by showing a great work ethic and getting deliverables done on time. \n\nI started working in the year 2010 as an IT personnel in a rising company. Responsibilities included system creation, automation, networking, and anything related to IT. Then afterward worked as a technical support/customer service/sales rep as our main task was to provide immediate support for their device which includes networking issues. It was exciting and challenging as we were measured by customer satisfaction but at the same time given sales quotas by up-selling warranties. One time our team struggled with our main metric CSAT(customer satisfaction), I came up with a resolution by calling our customers back and this overturned everything. Our lowlights became highlights, how I did this was not just by simply calling back but by connecting to the people I\'m talking with, ensuring to them that we\'re willing to sit and spend time just to help them. After which I transferred to a printer company which I spent 4 years as technical support. We were responsible for making sure their printer is fully functional and network connected. We were introduced to support various operating systems like Windows, macOS, Linux, etc. Then in the same company, I transitioned to a business administrative role where I spent 2 plus years. This role offered different dimensions and fields. I was responsible to help account managers and sales reps, it involves opportunity management, forecast management, quote creation, data analysis, report creation and analysis, demo/seed request creation, product research, and comparison, as well as product recommendation. It honed my skills in the tools we\'re using (Microsoft excel, d365, Power BI). One major pain point our team experienced was keeping track of our cases and that it was aging and causing delays. We had a report in place however it\'s obvious that was not effective. I then came up with a whole different report using power BI, which highlights the tickets/cases age with details. Fair enough it did provide tremendous help as it fixed our issue after a week. \n\nI believe that we never stop learning. No matter how good and knowledgeable we are there are things we can learn and things we can improve on. This drives and motivates me in what I\'m doing. Go ahead, try me. I might be the one you\'re looking for in the long term.', NULL, NULL, NULL, NULL, 'Edwin B.', 'IT Helpdesk|Technical Support | Data Entry | Virtual Assistant', 'Talisay City, Philippines', NULL, NULL, '0', NULL, '100', '21', '8,676', '\"[\\\"Email Support\\\",\\\"Data Entry\\\",\\\"Ticketing System\\\",\\\"Office 365\\\",\\\"Technical Support\\\",\\\"Helpdesk\\\",\\\"Customer Service\\\",\\\"Administrative Support\\\",\\\"Customer Support\\\",\\\"Microsoft Windows\\\",\\\"Search Engine Optimization\\\",\\\"Email Communication\\\",\\\"Virtual Assistance\\\"]\"', NULL, 'api', '2025-10-01 15:46:15', '2025-10-01 15:46:15', '2025-10-01 15:46:16', 'https://www.upwork.com/freelancers/~01bf7daa62f2e2d022');
