(55028, 10, NULL, '~019cb114488fbdbfe9', 'I am a Tech/IT Support Engineer with extensive professional experience in the IT support sector. I specialize in resolving issues with computers, laptops, and MacBooks, either through remote access or screen sharing. My expertise includes Windows 10, Windows 11, macOS, and administration of Microsoft Office 365, Microsoft Teams, and Microsoft Outlook. Additionally, I am skilled in managing Google Workspace, Gsuite, Gmail, and Google Business Email. I handle domain and exchange setups, email sending and receiving, email deliverability, spam issues, DNS record setups, and email migrations. My proficiency also extends to OneDrive, Google Drive, and setting up and configuring cold email systems or email marketing solutions.\n\nCertified:\nüéØ CompTIA A+\nüéØ CompTIA ITF+\nüéØ Cisco Certified Network Associate (CCNA)\n\n- Configure or resolve issues with email sending/receiving, deliverability, spam, or junk email problems.\nProvide IT support for Windows 10, Windows 11, and macOS.\n- Troubleshoot emails not sending to personal Gmail accounts and emails marked as spam in Gmail.\n- Set up and manage Microsoft Office 365, Outlook, Teams, Exchange, and OneDrive.\n- Configure and manage Google Business Email, Gmail, G Suite, or Google Workspace.\n- Handle email migrations across platforms (e.g., Google Workspace to Office 365, Gmail to Outlook).\n- Set up or troubleshoot email, webmail, and domains (including GoDaddy, Namecheap, Cloudflare, Squarespace, IONOS, Bluehost, SiteGround, OVH, Shopify, HostGator).\n- Address email deliverability and DNS record issues (MX, TXT, SPF, DMARC, DKIM, CNAME, A, AAA, SRV).\n- Remove your email, domain, or IP from blacklists like Spamhaus DB, RAZOR, or SORBS.\n- Verify your domain with Google Postmaster Tools.\n- Conduct email warm-up, domain reputation checks, and set up DMARC with a quarantine enforcement policy.\n- Resolve issues with email cPanel, POP, IMAP, SMTP authentication, two-step veri