(55023, 10, NULL, '~015b3bc39772a45134', 'Hello.\n\nI offer professional translation and proofreading services in Swedish and English. As a native Swedish speaker with C2-level English proficiency, I ensure that translations are not only accurate but also natural and fluent, making content resonate with native speakers. I pay close attention to detail and strive for high-quality results in every project.\n\nIn addition to my linguistic skills, I have an extensive background in IT support, troubleshooting, and problem-solving across multiple platforms including Mac OS X, iOS, Windows, Windows Server, and Android. I am well-versed in both hardware and software issues, and my experience ranges from first and second-line IT support to working on virtual machines and Google Admin.\n\nTranslation & Proofreading: I provide top-notch translations and meticulous proofreading for websites, documents, and multimedia content. I specialize in making content accessible and engaging for native speakers, ensuring that the original tone and meaning are preserved.\n\nIT Support: My expertise includes hardware troubleshooting, virtual environments, and network management, including Windows Server and Active Directory.\n\nVideo Editing: In my free time, I create and edit videos for my YouTube channel using iMovie, where I enjoy crafting engaging content.\n\nWith 30 years of computer experience , I have the technical know-how and language skills to handle diverse challenges. Whether it\'s setting up troubleshooting or delivering precise translations, I can help you achieve your goals.\n\nFeel free to reach out to discuss your project needs, and I‚Äôll be happy to assist!', '\"[{\\\"school\\\":\\\"Movant - Network technology\\\",\\\"details\\\":\\\"Other, Network technology | 2020-2021\\\"},{\\\"school\\\":\\\"Yrkesakademin\\\",\\\"details\\\":\\\"Other, Car inspection | 2018-2019\\\"},{\\\"school\\\":\\\"Gr\\\\u00f6nlunds Yrkestrafiksskola\\\",\\\"details\\\":\\\"Other, Commercial truck