\nprogram Heat. Fixed both software and hardware issues. Installed software\\\\non Mac, PC and iPhone and added them to active directory. Used Intune\\\\nfor software installation on the phones. Also upgraded computers with more\\\\nRAM, larger or extra SSDs, and troubleshooted hardware issues..\\\"}]\"', '\"[{\\\"title\\\":\\\"Swedish Native Speaker\\\",\\\"rating\\\":\\\"5.0\\\",\\\"dateRange\\\":\\\"Jul 28, 2025\\\\n    \\\\n       - \\\\n      \\\\n        Aug 26, 2025\\\",\\\"feedback\\\":\\\"\\\\\\\"I was asked to translate a title into Swedish, which was clear and straightforward. After that, I received an additional request to translate a bit more, but it was still\\\\u2026\\\",\\\"earnings\\\":\\\"$15.00\\\",\\\"rate\\\":null,\\\"hours\\\":null,\\\"jobType\\\":\\\"Fixed\\\",\\\"status\\\":\\\"Completed\\\",\\\"isEnterprise\\\":false},{\\\"title\\\":\\\"Native Swedish language voice conversation recording  project\\\",\\\"rating\\\":\\\"5.0\\\",\\\"dateRange\\\":\\\"Jul 23, 2025\\\\n    \\\\n       - \\\\n      \\\\n        Aug 25, 2025\\\",\\\"feedback\\\":\\\"\\\\\\\"\\\\\\\"Outstanding work! delivered exactly what I needed with professionalism and attention to detail. Communication was clear and timely, and they went above and beyond to ensure the project\'s success. Highly\\\\u2026\\\",\\\"earnings\\\":\\\"$62.50\\\",\\\"rate\\\":\\\"$25.00\\\",\\\"hours\\\":\\\"3\\\",\\\"jobType\\\":\\\"Hourly\\\",\\\"status\\\":\\\"Completed\\\",\\\"isEnterprise\\\":false},{\\\"title\\\":\\\"Swedish Worker Needed\\\",\\\"rating\\\":null,\\\"dateRange\\\":\\\"Sep 25, 2025\\\\n    \\\\n       - \\\\n       \\\\n        Present\\\",\\\"feedback\\\":\\\"Job in progress\\\",\\\"earnings\\\":null,\\\"rate\\\":null,\\\"hours\\\":null,\\\"jobType\\\":\\\"Fixed\\\",\\\"status\\\":\\\"In Progress\\\",\\\"isEnterprise\\\":false},{\\\"title\\\":\\\"French Canadian\\\\/Swedish -  Transcription (conversational) Project\\\",\\\"rating\\\":null,\\\"dateRange\\\":\\\"Sep 3, 2025\\\\n  