(55017, 10, NULL, '~0127cf8c0d1cdbc307', 'An IT Help Desk Technician is responsible for providing technical support and assistance. They interact with customers by phone or in-person to resolve their computer problems related to software and hardware issues to help them get back up running smoothly again. \nHelp Desk Job Duties\nResponding to queries via chat, email, or phone\nTraining other staff members on troubleshooting and diagnosing problems\nWriting, editing, and revising training manuals for new and updated software and hardware\nProviding technical assistance for questions and problems\nResolving problems with networks and other computer systems\nDiagnosing system errors and other issues\nFollowing up with customers to ensure full resolution of issues\nRequesting feedback and/or monitoring calls and other methods of correspondence to improve training methods\nRunning reports to analyse common complaints and problems\nInstalling or changing software to fix issues\nRemotely accessing hardware or software for clients to make changes and fix problems', '\"[{\\\"school\\\":\\\"University of Cebu\\\",\\\"details\\\":\\\"Bachelor\'s degree, Nursing | 2003-2006\\\"},{\\\"school\\\":\\\"University of Cebu\\\",\\\"details\\\":\\\"Bachelor of Science in Nursing (BSN) | 2003-2006\\\"}]\"', NULL, '\"[{\\\"title\\\":\\\"Help Desk Technician | Atos\\\",\\\"dateRange\\\":\\\"March 2015\\\\n      -\\\\n      Present\\\",\\\"description\\\":\\\"Offer support and technical assistance to customers who are using software, hardware, or other computer systems and need help completing tasks or troubleshooting problems through diagnostic tests and remote access to their computers.\\\"},{\\\"title\\\":\\\"Technical Specialist | Comcast\\\",\\\"dateRange\\\":\\\"April 2010\\\\n      -\\\\n      \\\\n        February 2015\\\",\\\"description\\\":\\\"Responsible for providing advanced high-speed technical support via inbound phone inquiries, email, and\\\\/or instant messaging. Trouble