(55016, 10, NULL, '~01b4413032ef572a60', 'I am Tony, an experienced IT professional with over 11 years in the industry. My expertise spans IT support, system administration, and service delivery, I pride myself on being a problem solver, adept at handling complex issues while maintaining a clear and professional communication style. My hands-on experience in IT operations, combined with a proactive learning mindset, enables me to adapt to new tools and processes efficiently. Whether it\'s configuring systems, resolving technical issues, or providing customer-facing support, I approach every task with dedication and attention to detail.\n\nWith a solid foundation in IT and a proven track record in both Level 1 and Level 2 technical support, I am confident in my ability to deliver reliable solutions and contribute positively to any organization I work with.\n\nIn my decade of experience in the Corporate IT Industry, here is how I can help you:\n\n‚òëÔ∏èMicrosoft 365 Administration (Exchange, Teams, SharePoint, OneDrive, etc.)\n‚òëÔ∏èMicrosoft Azure Administration (Conditional Access, Device Compliance etc.)\n‚òëÔ∏èActive Directory Management (Group Policy/OU Management, User/Device Onboard/Offboard, Attributes Configuration)\n‚òëÔ∏èWindows Server Administration\n‚òëÔ∏èHyper-V Management, Virtualization\n‚òëÔ∏èBackup and Recovery Management (Cove backup, Altaro, Action1)\n‚òëÔ∏èEmail and Domain Migration.\n‚òëÔ∏èOnboarding/Offboarding users on On Prem AD | O365 Admin Console\n‚òëÔ∏èWorkstation Setup (MacOS, Windows OS)\n‚òëÔ∏èRemote troubleshooting\n‚òëÔ∏è 3rd Party License Management and Deployment (Pax8 | Dicker Data)\n‚òëÔ∏èGoogle Workspace administration\n‚òëÔ∏èPatch Management/Deployment (N-Central/Action1)\n‚òëÔ∏è Security Operations (MS Defender, Mimecast, Avanan. Threatlocker, Huntress)\n‚òëÔ∏è Mobile (iOS | Android Support)\n‚òëÔ∏è Communications (MS Teams, Slack, GMeet, Discord, Zoom)\n‚òëÔ∏è KB Article documentation, management and proof-reading\n‚òëÔ∏è Problem Management, Root Cause Analysis, Reporting\n\nI am proficient in the following applications:\n\nüåüConnectWise Manage\nüåüServiceNow\nüåüHALO PSA\nüåü Atera RMM\nüåü Cyberdrain(CIPP)\nüåüITGlue / HUDU / HALO Kbm\nüåü Citrix Workspace/Receiver\nüåüConnectWise Automate\nüåü Cove Backup Solutions | Datto\nüåüN-Able | TeamViewer | Splashtop Admin | Log Me In(LMI)\nüåüTelephony Management (3CX | Avaya | Five9 | Grasshopper)\nüåüOKTA | Intune | Apple Business Mngr. | Jamf | DUO Mobile\nüåüVPN (Cisco Anyconnect, FortiClient, OpenVPN, Wireguard)\nüåü Windows Server | Azure AD | Entra ID | Exchange Admin\nüåü O365 Administration | Google Workspace Admin\nüåü Microsoft Entra, Defender, Purview, Priva\nüåü Mimecast, Avanan, IronScales, Proofpoint', '\"[{\\\"school\\\":\\\"STI College - Marikina\\\",\\\"details\\\":\\\"Associate\'s degree, Information Technology | 2009-2011\\\"}]\"', '\"[{\\\"name\\\":\\\"Threatlocker - Investing in Knowledge\\\",\\\"provider\\\":\\\"Threalocker\\\",\\\"issueDate\\\":\\\"September 2025\\\"},{\\\"name\\\":\\\"Seceon Certified Professional\\\",\\\"provider\\\":\\\"Seceon\\\",\\\"issueDate\\\":\\\"October 2020\\\"}]\"', '\"[{\\\"title\\\":\\\"Senior IT Technician | Sixt4\\\",\\\"dateRange\\\":\\\"July 2024\\\\n      -\\\\n      \\\\n        November 2024\\\",\\\"description\\\":\\\"As a Sr. IT Technician, I led the implementation of HALO PSA, managing its deployment, configuration, and user training to ensure seamless adoption. I also oversaw patch management using Action1, ensuring systems were secure and up-to-date through automated solutions and compliance monitoring. Additionally, I handled escalations by identifying root causes, coordinating with support teams, and ensuring timely resolutions to maintain customer satisfaction. My role required strong project coordination, reporting, and collaboration with stakeholders to deliver results on time and within scope.\\\"},{\\\"title\\\":\\\"MSP IT Technician | Hammertech\\\",\\\"dateRange\\\":\\\"April 2023\\\\n      -\\\\n      \\\\n        February 2024\\\",\\\"description\\\":\\\"As a Helpdesk Engineer at HammerTech, HI, a Managed Service Provider (MSP), I provided IT support to a wide range of clients, troubleshooting hardware, software, and network issues while ensuring prompt and reliable service delivery. Supporting multiple clients allowed me to develop expertise in various tools and technologies, including QuickBooks troubleshooting, Atera, Splashtop, CIPP, Avanan Hornet Securities, and Huntress. I managed and resolved tickets using service management platforms, escalated complex issues to senior engineers when needed, and ensured thorough documentation of incidents. This role strengthened my ability to adapt to diverse client environments and deliver tailored IT solutions efficiently.\\\"},{\\\"title\\\":\\\"IT Service Desk Engineer | RFA\\\",\\\"dateRange\\\":\\\"August 2020\\\\n      -\\\\n      \\\\n        February 2023\\\",\\\"description\\\":\\\"As a Helpdesk Engineer at RFA, a Managed Service Provider (MSP), I provide IT support to a diverse range of clients across multiple industries. I handle various technical issues, including hardware, software, and network-related concerns, ensuring prompt and effective resolutions. By managing support requests through troubleshooting, remote assistance, and clear communication, I maintain high service standards and client satisfaction. I document incidents, track tickets using service management tools, and escalate complex issues to higher-level teams as needed. Supporting multiple clients requires adaptability, strong technical knowledge, and a commitment to delivering efficient, high-quality solutions in a fast-paced environment.\\\"}]\"', '\"[{\\\"title\\\":\\\"MSP Technical Support & Operations Assistant\\\",\\\"rating\\\":null,\\\"dateRange\\\":\\\"Apr 28, 2025\\\\n    \\\\n       - \\\\n      \\\\n        May 27, 2025\\\",\\\"feedback\\\":\\\"No feedback given\\\",\\\"earning