(54995, 10, NULL, '~01472fd5f5c98ea4b8', 'For most of my life, I have been a freelance contractor and technology Consultant, offering both products and services related to communications, networking, electronic security, computing, and other related IT fields, currently working towards getting certified in Data Analysis. I enjoy traveling and adventure sports such as climbing. I also enjoy building devices and machines as a hobby, so I consider myself an inventor.\n\nI have over 6 years of experience in Customer Service and Technical Support, mostly in the North American market. Throughout my career, I have built a set of soft skills to enhance my technical background, and I like to learn about new products and services to allow me to properly represent your business and help me provide the best possible support and experience to your customers.\n\nI started working as a technical support representative for Sitel, a global BPO company, providing bilingual customer service for world-class companies such as Cox Communications and Lexmark.\n\nAfter this amazing opportunity, I worked in a freelance great position as a remote Technical Support agent for a Canadian communications firm providing world-class technical assistance with products like 3CX, CPBX, MS-Teams, and others. My last experience was as a Hardware Subject Matter Specialist for Advantive, a SaaS offering B2B solutions in different industries such as retail and automotive.\n\nI am a fast, self-learner, autonomous, and responsible person, detail-oriented, and a creative team player, and I am certain that I can bring value to your organization, the teams collaborating across it, and a great experience to your users.', '\"[{\\\"school\\\":\\\"Corporaci\\\\u00f3n Universitaria Minuto de Dios\\\",\\\"details\\\":\\\"Other, Data Science and Big Data | 2023-2024\\\"},{\\\"school\\\":\\\"Universidad Industrial de Santander\\\",\\\"details\\\":\\\"Software Development | 2021-2021\\\"},{\\\"school\\\":\\\"TenarisUniv