(54978, 10, NULL, '~0147ca47e407bf92c9', 'Hello! My name is Tomas, I‚Äôm the face behind Estudio Uno ‚Äî a design agency where technology, strategy, design, and SEO come together to develop digital products and experiences that are nothing less than outstanding. Estudio Uno collaborates with businesses and brands to fuel growth through smart design, technological innovation, effective search engine optimization, and an open process that places our clients at the center of all we do.\n\nHaving a cumulative experience of over 25 years as Project Management, Product Ownership, Business Intelligence, and Finance professionals, our team has successfully executed Fintech, Retail, Finance, and Pharmaceutical industry projects. We are committed to devoting strong organization, research, critical thinking, and technical implementation to all the projects we work on.\n\nOur project managers have worked with small as well as large teams, with defined goals, tasks well-understood, and regular tracking of progress through reports on a daily and weekly basis. We are extensively experienced with utilising tools like Jira, Trello, and Gantt chart creation to keep everything in sync and deadlines on track.\n\nWe bridge the gap between the creative and technical teams as Technical Project Managers ‚Äî facilitating seamless development and all technical details being met. Our QA expertise encompasses Mobile Android/iOS app testing, Web Application testing, Functional and End-to-End testing, Performance testing, reporting of bugs, test case creation, and test case streamlined system creation to facilitate team and client interaction.\n\nWe\'re also UX/UI design lovers. We practice DCU, IxD, User Research, Customer Journey Mapping, and Design Thinking to craft user-driven digital experiences. And, we add SEO best practices from the very first design and development stages so that our clients can reach more people and rank higher in search.\n\nIf you‚Äôre looking for a dedicated team tha