(54966, 10, NULL, '~01fdff919eaa528792', 'üá¨üáß I am a native Italian Translator and voice over talent specializing in Audiovisual Content. I translate and adapt scripts from English, French and Spanish into Italian, ensuring natural, fluid dialogues that respect timing, lip-sync and cultural nuances.\n\nWith two years of training in voice acting and dubbing, I can also provide professional voice recordings for characters, narrations and audiovisual projects. \nMy work combines creativity, precision, and strict respect for deadlines to help you bring your content life for the Italian audience.\n\n\nüíº‚ÄãSERVICES:\n‚úîÔ∏è‚ÄãTranslator (EN/FR/ES to IT)\n‚úîÔ∏è‚ÄãScript adaptation for Dubbing \n‚úîÔ∏è‚ÄãSubtitling and Localization\n‚úîÔ∏è‚ÄãVoice acting / Voice over (Italian)\n\n\nüáÆüáπ Sono una traduttrice e doppiatrice italiana specializzata in traduzione audiovisiva. Traduco e adatto copioni dall\'inglese, dal francese e dallo spagnolo all\'italiano, assicurandomi di ottenere dei dialoghi naturali e fluidi che rispettano i tempi delle battute, il sincronismo labiale e le sfumature culturali.\n\nHo una formazione come attrice doppiatrice, posso aiutarti fornendoti registrazioni vocali professionali per personaggi, narrazioni e progetti audiovisivi. \n\nIl mio lavoro combina creativit√†, precisione e rigoroso rispetto delle scadenze.\nContattami e insieme daremo vita ai tuoi contenuti!\n\n\nüíºSERVIZI:\n‚úîÔ∏èTraduzione (EN/FR/ES to IT)\n‚úîÔ∏èAdattamento per il doppiaggio \n‚úîÔ∏èSottotitolaggio\n‚úîÔ∏èVoice over', '\"[{\\\"school\\\":\\\"La Sapienza, Rome, Italy\\\",\\\"details\\\":\\\"Bachelor\'s degree |\\\"},{\\\"school\\\":\\\"Liceo Linguistico Europeo Maestre Pie Filippini, Frascati, Italy\\\",\\\"details\\\":\\\"High school degree |\\\"},{\\\"school\\\":\\\"Voice Art Dubbing\\\",\\\"details\\\":\\\"Master\'s degree, Dubbing | 2024-2025\\\"}]\"', NULL, '\"[{\\\"title\\\":\\\"Machine Learning Quality Specialist | Link Translation\\\",\\\"dateRange\\\":\