ar, Bass, all performed live if needed.\n\nüí¨ What Clients Say:\n‚ÄúJesus was the answer to ALL our problems. The soundtrack he created elevated the whole film, emotional, powerful, and completely original.‚Äù\n‚Äî Owen, ARRYBA Films\n\nüöÄ Let‚Äôs Score Your Next Film, Game, or Campaign\nSend me a message or invite me to your job on Upwork to schedule a free creative consultation.\n\nLet‚Äôs make something that stands out, and sounds like nothing else.', '\"[{\\\"school\\\":\\\"Arjaus\\\",\\\"details\\\":\\\"Bachelor\'s degree, Music Production, Film Composition, Mix & Master (Advanced) | 2024-2026 (expected)\\\"},{\\\"school\\\":\\\"Live Audio\\\",\\\"details\\\":\\\"Bachelor\'s degree, Music Business & Engineering | 2020-2024\\\"},{\\\"school\\\":\\\"Taller de Arte Sonoro\\\",\\\"details\\\":\\\"Bachelor of Arts (BA), Music for Film, Sound Design, Music Production and Recording  | 2016-2020\\\"}]\"', NULL, '\"[{\\\"title\\\":\\\"Executive Producer and Composer  | LA MOBB\\\",\\\"dateRange\\\":\\\"July 2024\\\\n      -\\\\n      Present\\\",\\\"description\\\":\\\"I am the Founder of LA MOBB, a Music & Sound Design Studio specialized in film scoring, soundtrack composition, and immersive sound design for films, trailers, and videogames.\\\\n\\\\nMy work focuses on crafting cinematic, high-quality audio experiences that enhance storytelling and bring powerful emotions to the screen. I combine orchestral scoring, electronic production, ambient textures, and sound effects to deliver unique soundtracks that perfectly align with each project\\\\u2019s creative vision.\\\\n\\\\nWith experience in film scoring, soundtrack production, sound design for games, Foley, and audio post-production, I collaborate closely with directors, producers, and developers to create music and sound that truly support the narrative.\\\\n\\\\nIf you are looking for custom scoring, soundtrack composition, sound design, or complete audio production for your film, short film, cinematic traile