(54946, 3201, NULL, '~016a1d79d2d98c5554', '‚≠ê 25 years as a professional software developer  \n‚≠ê Specialized in full-stack (backend heavy) apps with Node.js & React  \n‚≠ê Expert in building fast scripts with JavaScript and Python  \n‚≠ê Passionate about web scraping and data automation  \n‚≠ê Advanced skills in generating dynamic Excel reports  \n‚≠ê Strong background across public, academic, and enterprise sectors  \n‚≠ê Committed to delivering smart, scalable, and timely solutions \n‚≠ê Experience working on projects in Brazil, the United States, Canada and New Zealand.\n\nWith 25 years of full-time experience as a Systems Analyst and Software Developerüßë‚Äçüíª, I\'m now starting my journey as a freelancer, offering both long-term full-stack development and short-term solutions tailored to client needs.\n\nOver the past four years, I\'ve been specializing in full-stack web development using Node.js and React, building scalable and high-performing applications. But I\'m also deeply passionate about solving quick, practical problems through custom scripts, especially using JavaScript and Python. I have extensive experience creating powerful web scrapers and transforming raw data into structured Excel tables for business use.\n\nThroughout my career, I\'ve worked across diverse sectors including public infrastructure, transportation, education, healthcare, and technology R&D. Some highlights include:\n- Leading the development of a highway maintenance system for DNIT at LabTrans (UFSC)\n- Building a cloud cost monitoring system using AWS at UNICAMP\'s Center for Petroleum Studies\n- Developing a budget management system for IBM US while working with their New York-based team\n\nI\'m results-driven, adaptable, and value clear communication and quality delivery. Whether you need a robust web application, a fast automation script, a custom data scraper, or well-formatted Excel reporting, I\'m ready to help.\n\nAlthough I currently hold a full-time position as a 