(54938, 3201, NULL, 'jamaln18', 'I‚Äôm a Sr. AI/ML Engineer specializing in Computer Vision, NLP, Large Language Models Deep Learning, and OCR systems. Over the past 8+ years, I‚Äôve built and deployed production-grade solutions ranging from real-time video analytics and object detection pipelines to intelligent chatbots, RAG-based systems, and document automation. My focus is on delivering scalable, reliable AI applications that move beyond prototypes and create real business impact.\n\nWhat I Do\nI specialize in full-cycle AI system development, from model training and fine-tuning to secure, scalable deployment. My work powers:\n\nKYC & Identity Verification Pipelines\n\nHealthcare Data Extraction & Risk Analysis\n\nLegal Document Parsing & Summarization\n\nFinancial PDF Review & Invoice Automation\n\nReal Estate Listing Intelligence & Lead Matching\n\nGPT-4 Assistants for Customer Support & Internal Tools\n\nOCR + LLM Pipelines for High-Volume Document Processing\n\nCore AI Expertise\nNLP & LLMs\nModels: GPT-4, ChatGPT, Claude, Gemini, LLaMA, BERT, Falcon\nTasks: Summarization, NER, Sentiment Analysis, Q&A Systems\nFrameworks: LangChain, HuggingFace Transformers, RAG Pipelines, OpenAI API\n\nComputer Vision & OCR\nDetection Models: YOLOv5/v8, Faster R-CNN, SSD\nOCR Engines: Tesseract, EasyOCR, PaddleOCR\nApplications: License plate recognition, handwriting recognition, image segmentation\nGenerative Vision: Stable Diffusion, StyleGAN, Inpainting\n\nDeep Learning\nExtensive experience with CNNs, RNNs, Transformers, and attention-based architectures, applied to tasks such as vision-based detection, document intelligence, and speech analysis. Skilled in training, fine-tuning, and optimizing models in PyTorch and TensorFlow for both research and production-scale deployments.\n\nVoice & Speech AI\nTTS (Text-to-Speech), STT (Speech-to-Text), Voice Command Automation\n\nAI System Architecture & Deployment\nAPI Interfaces: FastAPI, Flask\nInteractive Apps: Streamlit, Webflow\nCloud Deployment: AWS (SageMaker, EC2, Bedrock), GCP (Vertex AI, BigQuery)\nDatabases: Pinecone, ChromaDB, MongoDB\nMLOps: MLflow, Docker, CI/CD, Kubeflow pipelines\n\nTools & Technologies\nLanguages: Python\nFrameworks: PyTorch, TensorFlow, Keras, OpenCV\nLibraries: spaCy, NLTK, Scikit-learn, NumPy, BeautifulSoup\nData & UI: PostgreSQL, MongoDB, Streamlit, Webflow, HTML/CSS\nVector Search: Pinecone, ChromaDB\n\nAI Systems I‚Äôve Built\n\nGPT + OCR engine for legal contract review\n\nLLM-powered financial PDF summarizer dashboard\n\nHIPAA-compliant healthcare intake & diagnosis assistant\n\nReal estate classifier combining NLP & computer vision\n\nVoice-based AI assistant for form automation\n\nAI-powered research assistant using LangChain + RAG + embeddings\n\nWhy Clients Hire Me\n\nI deliver end-to-end AI pipelines, not just scripts\n\nDeep experience in model optimization, evaluation, and secure deployment\n\nClean, modular, and documented codebases for long-term maintainability\n\nProven delivery across regulated industries (finance, legal, healthcare)\n\nFast, responsive, and invested in the outcome of your project\n\nGPT Developer, AI Engineer, Computer Vision Specialist, NLP Expert, Document AI Developer, OCR Pipelines, Deep Learning Engineer, PDF Data Extraction, FastAPI Developer, LLM Integration, GPT-4 Chatbot Developer, LangChain Developer, RAG Architect, Pinecone, ChromaDB, OpenAI API, AWS SageMaker, Vertex AI, MLOps, Transformer Models.\n\nLet‚Äôs build a custom AI system that delivers real value. Message me to discuss your project I usually respond quickly.', NULL, NULL, NULL, NULL, 'Jamal N.', 'Sr. AI/ML Computer Vision Deep Learning Engineer & OCR NLP | GPT + LLM', 'Germantown, USA', NULL, NULL, '0', NULL, '0', '3', '7', '\"[\\\"Artificial Intelligence\\\",\\\"Computer Vision\\\",\\\"Machine Learning\\\",\\\"Natural Language Processing\\\",\\\"PyTorch\\\",\\\"TensorFlow\\\",\\\"OpenAI API\\\",\\\"AI Chatbot\\\",\\\"LangChain\\\",\\\"Tesseract OCR\\\",\\\"FastAPI\\\",\\\"Retrieval Augmented Generation\\\",\\\"Deep Learning\\\",\\\"Large Language Model\\\",\\\"Python\\\"]\"', NULL, 'api', '2025-09-29 08:17:02', '2025-09-29 08:17:01', '2025-09-29 08:17:02', 'https://www.upwork.com/freelancers/jamaln18'),
