(54933, 3201, NULL, 'bakel', 'When you need the best results for a robotics job, you hire me! Period.\n\nI‚Äôm that robotics dude on full overdrive.\nNo girlfriend, no social life, just me, my robots, and a relentless loop of fixing  \"why isn\'t it working?!\"\n\nClients come to me for:\n‚úÖ Autonomous navigation systems for AUVs/USVs/UAVs/UGVs\n‚úÖ Robotics simulation, control & hardware integration\n‚úÖ Digital signal processing projects\n‚úÖ Computer vision & ML pipelines\n‚úÖ Embedded systems design and projects\n‚úÖ Deep-learning perception pipelines\n‚úÖ End-to-end robotic system development, from circuit to simulation to deployment\n‚úÖ Training and Mentorship for teams and documentation\n\nI‚Äôve built \n‚úÖ Autonomous USVs that won international competitions like the Aegan RoRo Race\n‚úÖ ROVs that perform complex underwater missions on their own.\n‚úÖ A tonne of Raspberry Pi + Arduino projects that do everything from monitoring plants to predicting glucose level from PPG in fingers\n‚úÖ Full-stack telepresence robots with video, audio, and real-time control over networks (ROS version and Custom code version based on the different clients needs)\n‚úÖ Real-time fault detection systems using deep learning for 3-phase power lines in Simulink\n‚úÖ Simulation-driven AUV platforms using Gazebo, PX4, and custom ROS 2 packages\n‚úÖ PID-tuned, motion-controlled embedded systems with custom PCBs and KiCad design\n‚úÖ Cross-platform interfaces with Flask, React, and cloud-based IIoT dashboards\n\nI teach foundational robotics, ROS2 and robotics control theory in live workshops and mentorships\n\nTech stack I breathe:\nROBOTICS\n‚úÖ Simulation & Visualization (Gazebo, Isaac Sim, Webots, RViz)\n‚úÖ Autonomous Navigation (Nav2, SLAM Toolbox, Cartographer)\n‚úÖ Path Planning & Control (DWA, A*, PID, MPC, Inverse Kinematics)\n‚úÖ Robotic Middleware (ROS, ROS 2, micro-ROS, TF, URDF, ros_control)\n‚úÖ Marine & Underwater Robotics (BlueROV, ArduSub, PX4, MAVLink)\n‚úÖ Robotic System Integration (Hardware-in-the-loop, SITL, ArduPilot, PX4-Autopilot)\n\nEMBEDDED SYSTEMS\n‚úÖ Microcontrollers (STM32, ESP32, Arduino, AVR)\n‚úÖ Single-Board Computers (Raspberry Pi, Jetson Nano, BeagleBone)\n‚úÖ Real-Time Control (FreeRTOS, timers, interrupts, PWM, PID)\n‚úÖ Communication Protocols (UART, I2C, SPI, CAN, RS485, MQTT, Bluetooth, WiFi)\n‚úÖ Custom Hardware Design (PCB with KiCad, 3D printing)\n\nSOFTWARE ENGINEERING\n‚úÖ Programming (C++, Python, Bash, C, MATLAB, JavaScript/Node.js)\n‚úÖ Docker, GitHub Actions, CI/CD pipelines\n‚úÖ Web Interfaces (React, Flask, WebSocket, REST APIs)\n‚úÖ Databases & Cloud Sync (Firebase, Blynk, PostgreSQL)\n‚úÖ Data Logging & Visualization (Matplotlib, Seaborn, Dash)\n\nCOMPUTER VISION & AI\n‚úÖ Perception Systems (OpenCV, PyTorch, TensorFlow, Keras)\n‚úÖ Object Detection (YOLO, Haar Cascades, Color Tracking, Contour Detection)\n‚úÖ Scene Understanding (Semantic Segmentation, Grad-CAM)\n‚úÖ Visual SLAM, Optical Flow, and Stereo Depth Estimation\n‚úÖ Underwater Inspection (Real-time damage detection on pipes, cables, and seabed)\n‚úÖ Dataset Collection, Annotation, and Model Training Pipelines\n\nIIOT, CONTROL, AND SYSTEMS INTEGRATION\n‚úÖ MQTT, Modbus, Serial-over-USB, Real-Time Telemetry\n‚úÖ Sensor Fusion (IMU, GPS, Depth, Barometer, Lidar, Sonar)\n‚úÖ Edge AI for Smart Monitoring & Alert Systems\n‚úÖ Control Loops with Feedback via ROS and Simulink\n‚úÖ Remote Monitoring Dashboards and Telepresence via Flask + WebRTC\n\nI won‚Äôt stop until:\n‚úÖ The bug is fixed (even if it‚Äôs 3AM and I‚Äôm arguing with a sensor)\n‚úÖ The simulation finally matches real-world data,\n‚úÖ The PID is tuned so well it sings lullabies to the actuators,\n‚úÖ The robot navigates like it has Google Maps in its bloodstream,\n‚úÖ and the ROS nodes aren‚Äôt throwing errors like it‚Äôs a contest.\n\nIf it moves, thinks, swims, blinks, or explodes, I‚Äôve probably built it, fixed it, or cursed at it.', NULL, NULL, NULL, NULL, 'Bakel B.'