(54925, 3201, NULL, '~016d2d242cb15aceb1', 'Hi, I‚Äôm Maynul Hasan. I am a detail-oriented Data Annotator with 2 years experience in labeling images, text, and video data for machine learning and AI projects. I‚Äôm reliable, deadline-driven, and ready to work across any time zone.\n\nüëâ My Services:\n\nüî∏  Video/Image Annotation\nüî∏  Image Classification\nüî∏  Key point Annotation\nüî∏  Object Detection (Bounding Boxes)\nüî∏  Object Recognition (Polygons)\n\nüõ†Ô∏è Tools  I basically Use \n\n‚ôªÔ∏è Computer Vision Annotation Tool (CVAT)\n‚ôªÔ∏è Labelbox\n‚ôªÔ∏è Label studio \n‚ôªÔ∏è RoboFlow\n‚ôªÔ∏è Supervisely\nand other web-based tools.\n\nüíé Output Formats:\n\nüìÑ XML\nüìÑ YOLO\nüìÑ JSON\nüìÑ COCO\nüìÑ CSV\nüé≠ Segmentation Masks\n\nüö© Data Types: üñºÔ∏è Images üé• Videos üìÑ Text\n\nüì¢  Important Note:\n‚ö†Ô∏è I do NOT train models.\n‚ö†Ô∏è I do NOT create applications.\n‚ö†Ô∏è I do NOT write Python scripts.\n‚úÖ I Deliver Customized, Reliable Data Format\nü§ùI can also provide a team of people with the same skill set and experience based on your project\'s requirements.\n\nLet\'s connect to discuss how I can help you to achieve the highest quality training data! Get a better idea of my expertise by visiting the portfolio section.', NULL, NULL, NULL, NULL, 'Maynul  H.', 'Data Annotation Expert | AI Data Labeling | Image/Video Annotation', 'Gopalganj, Bangladesh', NULL, NULL, '0', NULL, '0', NULL, NULL, '\"[\\\"Data Annotation\\\",\\\"Image Annotation\\\",\\\"Video Annotation\\\",\\\"Image Segmentation\\\",\\\"Data Segmentation\\\",\\\"Data Labeling\\\",\\\"Artificial Intelligence\\\",\\\"Machine Learning\\\",\\\"Computer Vision\\\"]\"', NULL, 'api', '2025-09-29 07:43:27', '2025-09-29 07:43:27', '2025-09-29 07:43:27', 'https://www.upwork.com/freelancers/~016d2d242cb15aceb1'),
