(54923, 3201, NULL, '~01ace5043cad16e7b1', 'With many years of experience in writing, editing, and translating texts, I can provide top-quality services in Dutch. Having solid background knowledge in delivering precise and attractive content, I have cooperated with customers such as national Dutch publishers, international companies like Microsoft, Tommy Hilfiger and Thomas Cook Travel, and many small and mid-sized (online) enterprises in The Netherlands and Belgium. Since mid 2024 I am also active as an AI trainer specialized in the Dutch language, meaning I have gained experience in annotating, tagging and labeling Dutch texts, audio and video.\n\nMain skills:\n\n- Writing: creating interesting materials for different types of media (articles, blog posts, etc.);\n\n- Editing: proofreading texts to make them error-free and stylishly correct according to grammar rules;\n\n- Translation (English - Dutch): accurately conveying the meaning of a source text within specific business areas.\n\n- AI training: annotating, tagging and labeling Dutch texts, audio and/or video.\n\nMy strong points are:\n\n- Attention to detail: being very precise about everything I do so that output meets desired standards exactly without any mistakes left unnoticed;\n\n- Adaptability: being able to adjust myself if necessary while working under time pressure or when some requirements change during project realization;\n\n- Responsibility: systematically providing customers with high-quality works on agreed terms thus establishing trustful relationships and long-term cooperation;\n\n- Easy communication: keeping in touch with clients regularly and ensuring that their needs always listened to attentively which helps me exceed their expectations easily.\n\nWhy Select Me:\n\n- Long track record: Having been in the industry for a long time, I have a good grasp of what clients need and expect.\n\n- Expertise: With my knowledge of different writing styles and formats as well as proficiency in the Dutch language I can provide amazing output.\n\n- Customer Centricity: Projects are completed based on the customers\' satisfaction so they must be up to standard and meet their specific needs.\n\nLet‚Äôs Work Together:\n\nIf you are searching for a dependable Dutch-speaking expert in text creation, proofreading, translations or training your Dutch AI model, then reach out to me. Talk about your assignment with me today and how best I can help you achieve it.', NULL, NULL, NULL, NULL, 'Steven P.', 'Dutch Language Specialist for Writing, Editing and AI Training', 'Ribeira Brava, Portugal', NULL, NULL, '0', NULL, '100', '27', '158', '\"[\\\"Blog Content\\\",\\\"Dutch\\\",\\\"Blog Writing\\\",\\\"Article Writing\\\",\\\"SEO Content\\\",\\\"Writing\\\",\\\"Press Release Writing\\\",\\\"Product Description\\\",\\\"Translation\\\",\\\"German to Dutch Translation\\\",\\\"Dutch to English Translation\\\",\\\"English to Dutch Translation\\\",\\\"Data Annotation\\\",\\\"Video Annotation\\\",\\\"Data Labeling\\\"]\"', NULL, 'api', '2025-09-29 07:39:47', '2025-09-29 07:39:47', '2025-09-29 07:39:48', 'https://www.upwork.com/freelancers/~01ace5043cad16e7b1'),
